import {
  Text,
  View,
  TextInput,
  StyleSheet,
  SafeAreaView,
  Button,
} from "react-native";
import { useState } from "react";

const NewSession = () => {
  return (
    <SafeAreaView>
      <View>
        <Text>Title</Text>
        <TextInput style={styles.codeTextBox} />
        <Text>Description</Text>
        <TextInput style={styles.codeTextBox} />
        <Text>Duration</Text>
        <TextInput style={styles.codeTextBox} />
        <Text>Capacity</Text>
        <TextInput style={styles.codeTextBox} />
        <Button title="Create" />
      </View>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  codeTextBox: {
    borderWidth: 1,
    borderColor: "black",
    borderRadius: 5,
    padding: 5,
    width: 200,
  },
});

export default NewSession;
